[spoiler]Я переродилась в ином мире, став главной героиней третьесортной и предсказуемой новеллы. Я решила жить, как и положено героине, наслаждаясь прекрасной жизнью с главным героем&hellip; Но что в этой новелле с романтической линией?! Героя постоянно окружают другие женщины&hellip; И, кажется, он совсем не против. Меня постоянно похищают и угрожают. Я просто хочу спокойной жизни! Порвав с героем, я решила выйти замуж за мужчину, с которым познакомилась на свидании вслепую, но&hellip; Что? Мой будущий муж - король демонов?![/spoiler]
